import Link from 'next/link';

type JobProps = {
  title: string;
  id: string;
}

export const Job = ({ title, id }: JobProps) => (
  <li>
    <Link href={`/jobs/[id]`} as={`/jobs/${id}`}>
      <a>{title}</a>
    </Link>
  </li>
)

export default Job
